INSERT INTO `sym_entries_data_113` (`id`, `entry_id`, `value`, `value_formatted`)
VALUES
	(4546,7744,'Our text tonight describes a picture of the throne and what was going on around it.  From this somewhat brief passage, we learn a lot about a wide range of topics ','&lt;p&gt;Our text tonight describes a picture of the throne and what was going on around it.  From this somewhat brief passage, we learn a lot about a wide range of topics '),
	(4547,7745,'Tonight','&lt;p&gt;Tonight'),
	(4548,7746,'In Romans 12:1, Paul urges ','&lt;p&gt;In Romans 12:1, Paul urges '),
	(4549,7747,'Revelation 7 is an amazing chapter.  John takes a moment, between the 6th and 7th seals to explain a bit about the 144,000 sealed believers and the tribulation saints.  We are able to take in an amazing picture of what is going in heaven during this time.','<p>Revelation 7 is an amazing chapter.  John takes a moment, between the 6th and 7th seals to explain a bit about the 144,000 sealed believers and the tribulation saints.  We are able to take in an amazing picture of what is going in heaven during this time.</p>\n'),
	(4545,7743,'In Revelation 5, a drama begins to unfold in heaven.  John sees a scroll and is distraught over the fact that no one is able to open it.  Then the Lamb appears.  Our focus tonight is on our Messiah, our Redeemer, the One who is worthy to open the scroll and its seals.','<p>In Revelation 5, a drama begins to unfold in heaven.  John sees a scroll and is distraught over the fact that no one is able to open it.  Then the Lamb appears.  Our focus tonight is on our Messiah, our Redeemer, the One who is worthy to open the scroll and its seals.</p>\n'),
	(4544,7742,'In Romans 11, Paul discusses God','&lt;p&gt;In Romans 11, Paul discusses God'),
	(4543,7741,'Romans 9, 10, and 11 delve further into the answer to this question: What must one do to be saved? In Romans 10, we see that Paul talks about the reasons why people reject salvation, the reality of their rejection, and the results of their rejection.','<p>Romans 9, 10, and 11 delve further into the answer to this question: What must one do to be saved? In Romans 10, we see that Paul talks about the reasons why people reject salvation, the reality of their rejection, and the results of their rejection.</p>\n'),
	(4540,7738,'Romans 9 through 11 is a crucial passage regarding the Jews and the plans that the Lord still has for them.  In a day and age when Replacement Theology seems to be gaining ground, these chapters are essential for our understanding.  We take a deeper look tonight at chapter 9 and the promises God has made to His chosen people.','<p>Romans 9 through 11 is a crucial passage regarding the Jews and the plans that the Lord still has for them.  In a day and age when Replacement Theology seems to be gaining ground, these chapters are essential for our understanding.  We take a deeper look tonight at chapter 9 and the promises God has made to His chosen people.</p>\n'),
	(4541,7739,'What part does faith play in our lives as believers?  In today','&lt;p&gt;What part does faith play in our lives as believers?  In today'),
	(4542,7740,'As we examine the letter to the church at Laodicea, we find that there are many correlations between that church and the greater church today.  This teaching highlights the dangers of relativism and liberalism within the church, which seem to be growing trends.  What is the solution?  We need to make sure that Jesus is at home, not only in our hearts, but in our churches as well.','<p>As we examine the letter to the church at Laodicea, we find that there are many correlations between that church and the greater church today.  This teaching highlights the dangers of relativism and liberalism within the church, which seem to be growing trends.  What is the solution?  We need to make sure that Jesus is at home, not only in our hearts, but in our churches as well.</p>\n'),
	(4537,7735,'In our text, Jesus is described as a stone.  We take a look at several passages in scripture that give us deeper insight into the richness of this picture.  The bottom line is that Jesus IS a rock.  The question for us is whether we will humble ourselves and be broken before Him, or whether we will harden ourselves and be broken by Him.  There are many wonderful applications for us from this passage.','<p>In our text, Jesus is described as a stone.  We take a look at several passages in scripture that give us deeper insight into the richness of this picture.  The bottom line is that Jesus IS a rock.  The question for us is whether we will humble ourselves and be broken before Him, or whether we will harden ourselves and be broken by Him.  There are many wonderful applications for us from this passage.</p>\n'),
	(4538,7736,'Tonight','&lt;p&gt;Tonight'),
	(4539,7737,'As we continue our study through the book of Revelation, we take a closer look at the church in Thyatira, found in Revelation 2:18-29. We see that while they are praised for their love, service, faith, and patience, they struggle greatly with fornication and idolatry. The application for today is realizing that if there is something more important to us than the Lord, it becomes idolatry, which is something that we as a church need to stay away from.','<p>As we continue our study through the book of Revelation, we take a closer look at the church in Thyatira, found in Revelation 2:18-29. We see that while they are praised for their love, service, faith, and patience, they struggle greatly with fornication and idolatry. The application for today is realizing that if there is something more important to us than the Lord, it becomes idolatry, which is something that we as a church need to stay away from.</p>\n'),
	(4535,7733,'This morning, Pastor Brett discusses the topics of Calvinism and Arminianism, predestination, and foreknowledge. In Romans 8:28-29, Paul writes about ','&lt;p&gt;This morning, Pastor Brett discusses the topics of Calvinism and Arminianism, predestination, and foreknowledge. In Romans 8:28-29, Paul writes about '),
	(4536,7734,'Tonight, in our through-the-Bible study, we continue to look at Romans 8:28-39. Pastor Brett further explains the concepts of predestination and foreknowledge, and how the Lord has a perfect plan for all of our lives.','<p>Tonight, in our through-the-Bible study, we continue to look at Romans 8:28-39. Pastor Brett further explains the concepts of predestination and foreknowledge, and how the Lord has a perfect plan for all of our lives.</p>\n'),
	(4533,7731,'The new year is just around the corner. Usual New Year','&lt;p&gt;The new year is just around the corner. Usual New Year'),
	(4534,7732,'As we continue our study through Romans, Paul discusses the  concepts of sin, redemption, mercy, and grace further. In chapter 8, he writes about how there is no condemnation to those who are in Christ Jesus. Pastor Brett talks about condemnation vs. conviction, how we have no obligation to the flesh, and how we have the hope of heaven.','<p>As we continue our study through Romans, Paul discusses the  concepts of sin, redemption, mercy, and grace further. In chapter 8, he writes about how there is no condemnation to those who are in Christ Jesus. Pastor Brett talks about condemnation vs. conviction, how we have no obligation to the flesh, and how we have the hope of heaven.</p>\n'),
	(4532,7730,'Tonight, we read Revelation 3:7-13, where we take a closer look at the church in Philadelphia, the city of brotherly love. The personal application we find here is the importance of evangelism in the church, and how essential it is to tell all the world about the gospel.','<p>Tonight, we read Revelation 3:7-13, where we take a closer look at the church in Philadelphia, the city of brotherly love. The personal application we find here is the importance of evangelism in the church, and how essential it is to tell all the world about the gospel.</p>\n'),
	(4531,7729,'In Romans 7, Paul continues to talk about the sinful nature of man, and the battle between the flesh and the spirit. Brett gives us an outline based on what Paul writes, discussing the sinful condition that we find ourselves in, to the conqueror of said condition, to the conclusion: If we want to see victory over the flesh, we need to walk in the spirit.','<p>In Romans 7, Paul continues to talk about the sinful nature of man, and the battle between the flesh and the spirit. Brett gives us an outline based on what Paul writes, discussing the sinful condition that we find ourselves in, to the conqueror of said condition, to the conclusion: If we want to see victory over the flesh, we need to walk in the spirit.</p>\n'),
