	(4526,7724,'As we study through Romans 5 tonight we find the theme of justification is something to celebrate!  Our focus is on the many blessings we have as the result of this important doctrinal truth.','<p>As we study through Romans 5 tonight we find the theme of justification is something to celebrate!  Our focus is on the many blessings we have as the result of this important doctrinal truth.</p>\n'),
	(4525,7723,'The Bible promises trials and tribulations, and yet they always seem to take us by surprise.  This morning we look at some of the ways the Lord redeems these hard times in our lives.  For anyone lacking hope, this is a great message of encouragement!','<p>The Bible promises trials and tribulations, and yet they always seem to take us by surprise.  This morning we look at some of the ways the Lord redeems these hard times in our lives.  For anyone lacking hope, this is a great message of encouragement!</p>\n'),
	(4524,7722,'Our focus tonight is on the elements of justification as Paul takes a close look at what it means for us as believers.','<p>Our focus tonight is on the elements of justification as Paul takes a close look at what it means for us as believers.</p>\n'),
	(4523,7721,'Too many people walk through life feeling that they are a disappointment to God.  Today, we take a look at this common misunderstanding in light of what the Bible says about how the Lord has dealt with our sin.','<p>Too many people walk through life feeling that they are a disappointment to God.  Today, we take a look at this common misunderstanding in light of what the Bible says about how the Lord has dealt with our sin.</p>\n'),
	(4521,7719,'This morning we take a look at God','&lt;p&gt;This morning we take a look at God'),
	(4522,7720,'The Bible shows us that the Lord loves  us, no matter what we\'ve done. Even though we don\'t deserve it, Jesus gave us the gift of eternal life. In Romans 4, Paul introduces this concept to the Jews, using Abraham and Sarah\'s story as an example.','<p>The Bible shows us that the Lord loves  us, no matter what we&#8217;ve done. Even though we don&#8217;t deserve it, Jesus gave us the gift of eternal life. In Romans 4, Paul introduces this concept to the Jews, using Abraham and Sarah&#8217;s story as an example.</p>\n'),
	(4520,7718,'In the letter to the church at Sardis, we find a message for the Protestant Church today.  The church is warned about spiritual deadness and is encouraged to strengthen what remains.  For us today, the message is clear ','&lt;p&gt;In the letter to the church at Sardis, we find a message for the Protestant Church today.  The church is warned about spiritual deadness and is encouraged to strengthen what remains.  For us today, the message is clear '),
	(4519,7717,'As we study through Romans 2, Paul presents his readers with a tough challenge.  While we all have the tendency to focus on the outward, Paul reminds that that God is more interested in our hearts.  In that light, none of us measure up, which makes the Lord','&lt;p&gt;As we study through Romans 2, Paul presents his readers with a tough challenge.  While we all have the tendency to focus on the outward, Paul reminds that that God is more interested in our hearts.  In that light, none of us measure up, which makes the Lord'),
	(4518,7716,'This morning, Hans talks about faith, and how our weaknesses make our faith stronger. When times are tough, we can put our faith in the Lord.','<p>This morning, Hans talks about faith, and how our weaknesses make our faith stronger. When times are tough, we can put our faith in the Lord.</p>\n'),
	(4517,7715,'Everyone goes through trials. The question is, what do we do when the trials come? Jeff discusses what the Bible says about trials, taking our thoughts captive, and keeping them focused on Jesus Christ.','<p>Everyone goes through trials. The question is, what do we do when the trials come? Jeff discusses what the Bible says about trials, taking our thoughts captive, and keeping them focused on Jesus Christ.</p>\n'),
	(4516,7714,'This morning, James discusses I Samuel 1, where Hannah has a problem. Instead of taking her troubles to her husband, Elkanah, she goes straight to the Lord. God blesses her immensely for this by giving her a son who will impact the children of Israel far more than anyone could have ever imagined.','<p>This morning, James discusses I Samuel 1, where Hannah has a problem. Instead of taking her troubles to her husband, Elkanah, she goes straight to the Lord. God blesses her immensely for this by giving her a son who will impact the children of Israel far more than anyone could have ever imagined.</p>\n'),
	(4515,7713,'So you\'ve become a Christian...What now? Derek talks about the abundance of life that the Lord offers and the fact that his mercies are everlasting.','<p>So you&#8217;ve become a Christian&#8230;What now? Derek talks about the abundance of life that the Lord offers and the fact that his mercies are everlasting.</p>\n'),
	(4514,7712,'This morning, Pastor Brett discusses the topic of circumcision, which is a representation of the cutting away of our flesh, or our sin. A summary of the old testament regulation of circumcision is discussed as it relates to the modern day expression of our commitment through baptism.','<p>This morning, Pastor Brett discusses the topic of circumcision, which is a representation of the cutting away of our flesh, or our sin. A summary of the old testament regulation of circumcision is discussed as it relates to the modern day expression of our commitment through baptism.</p>\n'),
	(4512,7710,'Tonight we continue on in our messages to the churches of Revelation 2.  Our text is the letter to the church at Pergamos and the theme is derived from the name of the church ','&lt;p&gt;Tonight we continue on in our messages to the churches of Revelation 2.  Our text is the letter to the church at Pergamos and the theme is derived from the name of the church '),
