	(4509,7707,'As we begin the book of Romans, Paul paints a pretty dark picture of mankind and our depravity.  Thankfully, that is not the end of the story.  The black backdrop of our sin and our need makes the beauty of the Lord','&lt;p&gt;As we begin the book of Romans, Paul paints a pretty dark picture of mankind and our depravity.  Thankfully, that is not the end of the story.  The black backdrop of our sin and our need makes the beauty of the Lord'),
