	(4506,7704,'As we dig into the messages to the churches, we learn that they will all have multi-level applications.  There are truths to be drawn locally, for the greater church, prophetically and personally.  With that in mind, we tackle this first message to the Ephesians, which has rich implications for all of us!','<p>As we dig into the messages to the churches, we learn that they will all have multi-level applications.  There are truths to be drawn locally, for the greater church, prophetically and personally.  With that in mind, we tackle this first message to the Ephesians, which has rich implications for all of us!</p>\n'),
	(4505,7703,'Tonight','&lt;p&gt;Tonight'),
	(4504,7702,'As Herod listens to Paul share the gospel story with him, he is so close to responding.  Even Paul can sense it.  However, he has some sins in his life he refuses to let go of in order to fully embrace Christianity.  Are there things in our lives that we hold onto too tightly that may hinder us from salvation?  Or from the abundant life the Lord has for us?  We can learn a thing or two from the tragic decision Herod made.','<p>As Herod listens to Paul share the gospel story with him, he is so close to responding.  Even Paul can sense it.  However, he has some sins in his life he refuses to let go of in order to fully embrace Christianity.  Are there things in our lives that we hold onto too tightly that may hinder us from salvation?  Or from the abundant life the Lord has for us?  We can learn a thing or two from the tragic decision Herod made.</p>\n'),
	(4503,7701,'We delve further into the first chapter tonight as we cover end times theology, false doctrine and the ascended Jesus who appears to John.','<p>We delve further into the first chapter tonight as we cover end times theology, false doctrine and the ascended Jesus who appears to John.</p>\n'),
