	(4495,7693,'As we study through Acts 21 & 22 tonight, we see Paul\'s determination as he makes his way to Jerusalem. The stage is set for the end of Paul\'s ministry, and we find much to ponder as we observe the way he carries himself in the face of persecution.','<p>As we study through Acts 21 &amp; 22 tonight, we see Paul&#8217;s determination as he makes his way to Jerusalem. The stage is set for the end of Paul&#8217;s ministry, and we find much to ponder as we observe the way he carries himself in the face of persecution.</p>\n'),
	(4494,7692,'Are we willing to die for our faith?  Not many of us have ever been in that kind of scenario.  However, there are plenty of little deaths that should happen in our lives.  How are we doing in those areas?  Acts 21 gives us a great jumping-off point to take a deeper look at things we are called to give up for the Lord.','<p>Are we willing to die for our faith?  Not many of us have ever been in that kind of scenario.  However, there are plenty of little deaths that should happen in our lives.  How are we doing in those areas?  Acts 21 gives us a great jumping-off point to take a deeper look at things we are called to give up for the Lord.</p>\n'),
	(4493,7691,'Acts 20 is a chapter that is packed full of insights about the early church.  There is much to be learned from Paul','&lt;p&gt;Acts 20 is a chapter that is packed full of insights about the early church.  There is much to be learned from Paul'),
	(4491,7689,'Acts 19 teaches us more about Paul','&lt;p&gt;Acts 19 teaches us more about Paul'),
	(4492,7690,'In this passage from Acts 20, Paul describes how he ministered to the church at Ephesus.  He sets a perfect example for us today as we are ALL called to be ministers of the gospel.','<p>In this passage from Acts 20, Paul describes how he ministered to the church at Ephesus.  He sets a perfect example for us today as we are ALL called to be ministers of the gospel.</p>\n'),
	(4489,7687,'In tonight','&lt;p&gt;In tonight'),
	(4490,7688,'As Paul ministers in the city of Ephesus, we see a city transformed by the teaching of the Word.  In addition to Acts 19, we also spend some time in Psalm 119 to delve into the life-changing power of the Bible.','<p>As Paul ministers in the city of Ephesus, we see a city transformed by the teaching of the Word.  In addition to Acts 19, we also spend some time in Psalm 119 to delve into the life-changing power of the Bible.</p>\n'),
	(4488,7686,'In Acts 17, Paul visits three different cities ','&lt;p&gt;In Acts 17, Paul visits three different cities '),
	(4487,7685,'In Acts 16, Paul and Silas are in a low place, beaten, bound and imprisoned.  Yet we find these two men praying and worshiping in the dark of night, from a prison cell.  There are priceless lessons for us to learn about prayer and worship in the midst of trials.  If you are feeling stuck, helpless or defeated, this teaching is for you.  There is hope and even joy to be found when we cry out to the Lord!','<p>In Acts 16, Paul and Silas are in a low place, beaten, bound and imprisoned.  Yet we find these two men praying and worshiping in the dark of night, from a prison cell.  There are priceless lessons for us to learn about prayer and worship in the midst of trials.  If you are feeling stuck, helpless or defeated, this teaching is for you.  There is hope and even joy to be found when we cry out to the Lord!</p>\n'),
	(4486,7684,'Acts 16 is the beginning of Paul','&lt;p&gt;Acts 16 is the beginning of Paul'),
	(4485,7683,'We take a longer look at the dispute that arose in Acts 15, and the defense presented by the apostles.  The crux of the matter was the burden of law & tradition that the Jewish believers wanted to impose on the new Gentile believers.  The church comes to a decision that brings joy and encouragement, which is what always results when believers extend grace to one another.','<p>We take a longer look at the dispute that arose in Acts 15, and the defense presented by the apostles.  The crux of the matter was the burden of law &amp; tradition that the Jewish believers wanted to impose on the new Gentile believers.  The church comes to a decision that brings joy and encouragement, which is what always results when believers extend grace to one another.</p>\n'),
	(4484,7682,'We are all flawed individuals. The Lord, however, is full of grace and forgiveness through Jesus Christ. We should forgive others because of how much God has forgiven us.','<p>We are all flawed individuals. The Lord, however, is full of grace and forgiveness through Jesus Christ. We should forgive others because of how much God has forgiven us.</p>\n'),
	(4483,7681,'Humanity is sinful by nature and deserves judgment. Yet, the Lord is so gracious to offer us the inheritance of eternal life in heaven when we accept Jesus Christ.','<p>Humanity is sinful by nature and deserves judgment. Yet, the Lord is so gracious to offer us the inheritance of eternal life in heaven when we accept Jesus Christ.</p>\n'),
	(4482,7680,'Acts 15 describes the dissension that arose as the Judaizers tried to saddle the new Gentile believers with Jewish traditions. What role did the law still play in this new faith? We spend some time studying Joseph, a wonderful OT picture of Jesus, and the many ways he seemed like an unlikely deliverer.  Our Savior, in like manner, didn','&lt;p&gt;Acts 15 describes the dissension that arose as the Judaizers tried to saddle the new Gentile believers with Jewish traditions. What role did the law still play in this new faith? We spend some time studying Joseph, a wonderful OT picture of Jesus, and the many ways he seemed like an unlikely deliverer.  Our Savior, in like manner, didn'),
	(4481,7679,'We cover the end of Paul\'s first missionary journey. It wasn\'t an easy one as he & Barnabas were met with extreme reactions. On the one hand, some gave them praise & exultation they neither wanted, nor sought. On the other end of the spectrum, they faced fierce opposition and even stoning. In all of this, the gospel was taught faithfully and brought about much fruit.','<p>We cover the end of Paul&#8217;s first missionary journey. It wasn&#8217;t an easy one as he &amp; Barnabas were met with extreme reactions. On the one hand, some gave them praise &amp; exultation they neither wanted, nor sought. On the other end of the spectrum, they faced fierce opposition and even stoning. In all of this, the gospel was taught faithfully and brought about much fruit.</p>\n'),
	(4480,7678,'Bobby Belt filled in for Pastor Brett this morning and shared a teaching about David and the powerful hope he had in the Lord. We, too, can find the strength that David did as we fix our eyes on the \'Author and Perfecter of our faith.\'','<p>Bobby Belt filled in for Pastor Brett this morning and shared a teaching about David and the powerful hope he had in the Lord. We, too, can find the strength that David did as we fix our eyes on the &#8216;Author and Perfecter of our faith.&#8217;</p>\n'),
	(4479,7677,'What does forgiveness really mean for us as believers?  This morning, we look to David, the man after God','&lt;p&gt;What does forgiveness really mean for us as believers?  This morning, we look to David, the man after God'),
	(4478,7676,'This chapter opens as the Holy Spirit selects Barnabus and Paul to be sent out by the church.  This begins Paul','&lt;p&gt;This chapter opens as the Holy Spirit selects Barnabus and Paul to be sent out by the church.  This begins Paul'),
	(4476,7674,'The story of Peter','&lt;p&gt;The story of Peter'),
	(4477,7675,'We cover a lot of ground as we finish up the last half of Acts 11 and all of chapter 12. Some of the highlights include the spread of the gospel to the Gentiles, the ministry of Barnabas and Paul\'s miraculous rescue from Herod\'s plot to kill him.','<p>We cover a lot of ground as we finish up the last half of Acts 11 and all of chapter 12. Some of the highlights include the spread of the gospel to the Gentiles, the ministry of Barnabas and Paul&#8217;s miraculous rescue from Herod&#8217;s plot to kill him.</p>\n'),
	(4475,7673,'In this ground-breaking time for the early church, the Lord uses Peter and Cornelius to show the rest of the believers that salvation is for everyone ','&lt;p&gt;In this ground-breaking time for the early church, the Lord uses Peter and Cornelius to show the rest of the believers that salvation is for everyone '),
	(4474,7672,'Our text, Acts 10:34-36, talks about the nation that fears God and does what is right.  What does this mean for America?  We take some time on this Fourth of July to look at our godly heritage as a nation, and to ponder how we as Christians should contribute to our country','&lt;p&gt;Our text, Acts 10:34-36, talks about the nation that fears God and does what is right.  What does this mean for America?  We take some time on this Fourth of July to look at our godly heritage as a nation, and to ponder how we as Christians should contribute to our country'),
	(4472,7670,'As we study through the first half of Acts 9, we witness the dramatic conversion of Saul, and the courageous obedience of Ananias.','<p>As we study through the first half of Acts 9, we witness the dramatic conversion of Saul, and the courageous obedience of Ananias.</p>\n'),
	(4473,7671,'As we continue on through Acts 9, we gain understanding as to what was going on in the early church at the time. The drastic change in Saul\'s life, Peter\'s ministry and the much-loved Tabitha are the main subjects of this chapter.','<p>As we continue on through Acts 9, we gain understanding as to what was going on in the early church at the time. The drastic change in Saul&#8217;s life, Peter&#8217;s ministry and the much-loved Tabitha are the main subjects of this chapter.</p>\n'),
	(4471,7669,'This chapter gives us a closer look at four main characters and what we can learn from each of them: Saul ','&lt;p&gt;This chapter gives us a closer look at four main characters and what we can learn from each of them: Saul '),
	(4470,7668,'Acts 8 takes a good look at Philip the Evangelist. Rather than setting forth a \'formula\' for witnessing, we see Philip\'s dependence on the Holy Spirit and his enthusiastic obedience, which resulted in powerful, fruitful evangelism.','<p>Acts 8 takes a good look at Philip the Evangelist. Rather than setting forth a &#8216;formula&#8217; for witnessing, we see Philip&#8217;s dependence on the Holy Spirit and his enthusiastic obedience, which resulted in powerful, fruitful evangelism.</p>\n'),
	(4469,7667,'The conclusion of this chapter is packed with important truths ','&lt;p&gt;The conclusion of this chapter is packed with important truths '),
	(4468,7666,'Stephen is a wonderful example of a New Testament believer whose life was drastically changed as he grew in his faith.  With this in mind, Pastor Brett offers some practical suggestions for those of us who long to see the Lord bring about real transformation in our own lives as well.','<p>Stephen is a wonderful example of a New Testament believer whose life was drastically changed as he grew in his faith.  With this in mind, Pastor Brett offers some practical suggestions for those of us who long to see the Lord bring about real transformation in our own lives as well.</p>\n'),
	(4466,7664,'Stephen','&lt;p&gt;Stephen'),
	(4467,7665,'As we take a look at the first portion of Stephen','&lt;p&gt;As we take a look at the first portion of Stephen'),
	(4465,7663,'When division creeps into the early church, the apostles respond by addressing the practical needs of the Body of believers.  The roles of elders and deacons begin to take shape and provide a great blueprint for churches today.','<p>When division creeps into the early church, the apostles respond by addressing the practical needs of the Body of believers.  The roles of elders and deacons begin to take shape and provide a great blueprint for churches today.</p>\n'),
	(4464,7662,'When the Word of God is being challenged, even perverted, how are we as Christians to respond?  Stephen, filled with the Spirit, provides us a perfect example as he addressed his attackers with strong faith, a solid grasp of Scripture and his glowing countenance.','<p>When the Word of God is being challenged, even perverted, how are we as Christians to respond?  Stephen, filled with the Spirit, provides us a perfect example as he addressed his attackers with strong faith, a solid grasp of Scripture and his glowing countenance.</p>\n'),
