	(4005,7203,'This study contains discussion about creation, prayer, the rapture and more.','<p>This study contains discussion about creation, prayer, the rapture and more.</p>\n'),
	(4004,7202,'This study contains discussion of Jesus','&lt;p&gt;This study contains discussion of Jesus'),
	(4003,7201,'This study contains discussion of America','&lt;p&gt;This study contains discussion of America'),
	(4002,7200,'This study contains discussion of the different attributes of Jesus Christ.','<p>This study contains discussion of the different attributes of Jesus Christ.</p>\n'),
	(4001,7199,'This study explores the different reactions to Jesus','&lt;p&gt;This study explores the different reactions to Jesus'),
	(4000,7198,'This study shows a glimmer of light in the midst of prophesies of judgment.','<p>This study shows a glimmer of light in the midst of prophesies of judgment.</p>\n'),
	(3999,7197,'This study contains discussion of Jesus Christ being the source of salvation and living water that never dries.','<p>This study contains discussion of Jesus Christ being the source of salvation and living water that never dries.</p>\n'),
	(3998,7196,'This study consists a prophesy of Jesus Christ, a mournful hymn, and a judgment upon Assyria.','<p>This study consists a prophesy of Jesus Christ, a mournful hymn, and a judgment upon Assyria.</p>\n'),
	(3997,7195,'We see the Trinity described in this prophesy of Jesus Christ.','<p>We see the Trinity described in this prophesy of Jesus Christ.</p>\n'),
	(3996,7194,'This study contains discussion of a fulfilled prophesy spoken in Isaiah chapter 8 of an Assyrian invasion into Israel. It shows the importance of trusting in the Lord.','<p>This study contains discussion of a fulfilled prophesy spoken in Isaiah chapter 8 of an Assyrian invasion into Israel. It shows the importance of trusting in the Lord.</p>\n'),
	(3995,7193,'This study contains discussion of the importance of Jesus','&lt;p&gt;This study contains discussion of the importance of Jesus'),
	(3994,7192,'We see that Isaiah realizes his sinful nature. A seraph then burns his lips as a measure of cleansing him from his sin.','<p>We see that Isaiah realizes his sinful nature. A seraph then burns his lips as a measure of cleansing him from his sin.</p>\n'),
	(3993,7191,'We learn to look only to Jesus. Comparing ourselves to Him helps us stay humble.','<p>We learn to look only to Jesus. Comparing ourselves to Him helps us stay humble.</p>\n'),
	(3992,7190,'This teaching includes discussion on topics such as the Arab/Israeli conflict, the temple mount, the six woes of Isaiah chapter 5 and more.','<p>This teaching includes discussion on topics such as the Arab/Israeli conflict, the temple mount, the six woes of Isaiah chapter 5 and more.</p>\n'),
	(3991,7189,'The seven women described in Isaiah 4:1 are an illustration of how depraved humanity is, and how we need to eat Jesus','&lt;p&gt;The seven women described in Isaiah 4:1 are an illustration of how depraved humanity is, and how we need to eat Jesus'),
	(3990,7188,'Chapter 2 and 3 include warnings for Israel and Judah of Judgment','<p>Chapter 2 and 3 include warnings for Israel and Judah of Judgment</p>\n'),
	(3989,7187,'We see that the Lord forgives all of our sin and makes it as if we had never sinned in the first place','<p>We see that the Lord forgives all of our sin and makes it as if we had never sinned in the first place</p>\n'),
	(3988,7186,'Brett begins going verse by verse through the book of Isaiah showing that its filled with prophesy.','<p>Brett begins going verse by verse through the book of Isaiah showing that its filled with prophesy.</p>\n'),
	(3987,7185,'Introduction to the book of Isaiah. Contains numerous examples of fulfilled prophesies concerning Jesus Christ.','<p>Introduction to the book of Isaiah. Contains numerous examples of fulfilled prophesies concerning Jesus Christ.</p>\n'),
