	(3701,6899,'We take a look at the initial coming of the Holy Spirit on the Day of Pentecost and what it meant for those early church believers, as well as what it means for us today.','<p>We take a look at the initial coming of the Holy Spirit on the Day of Pentecost and what it meant for those early church believers, as well as what it means for us today.</p>\n'),
	(3696,6894,'Martin Luther said that in order to fully understand the New Testament, it was necessary to understand the prepositions.  In this study, we look at their significance in relation to the Holy Spirit','&lt;p&gt;Martin Luther said that in order to fully understand the New Testament, it was necessary to understand the prepositions.  In this study, we look at their significance in relation to the Holy Spirit'),
