	(9,37,NULL,'Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Maecenas faucibus mollis interdum. Vestibulum id ligula porta felis euismod semper. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec sed odio dui.',NULL,'Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Maecenas faucibus mollis interdum. Vestibulum id ligula porta felis euismod semper. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec sed odio dui.',43,'<p>Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Maecenas faucibus mollis interdum. Vestibulum id ligula porta felis euismod semper. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec sed odio dui.</p>\n'),
	(11,48,NULL,'Its the most wonderful time of the year!  We will take an evening during this special month to gather and celebrate the birth of our Savior.  Dinner will be delicious, worship will be sweet and the fellowship will be warm.  To top it all off, Marna Slaughter will be sharing with us, which will be a special treat.  Please join us for a lovely evening to celebrate Christmas together.\r\n\r\nCost: $20\r\n\r\nQuestions: Email info@atheycreek.com or call (971)327-2120',NULL,'Its the most wonderful time of the year!  We will take an evening during this special month to gather and celebrate the birth of our Savior.  Dinner will be delicious, worship will be sweet and the fellowship will be warm.  To top it all off, Marna Slaughter will be sharing with us, which will be a special treat.  Please join us for a lovely evening to celebrate Christmas together.\r\n\r\nCost: $20\r\n\r\nQuestions: Email info@atheycreek.com or call (971)327-2120',75,'<p>Its the most wonderful time of the year!  We will take an evening during this special month to gather and celebrate the birth of our Savior.  Dinner will be delicious, worship will be sweet and the fellowship will be warm.  To top it all off, Marna Slaughter will be sharing with us, which will be a special treat.  Please join us for a lovely evening to celebrate Christmas together.</p>\n\n<p>Cost: $20</p>\n\n<p>Questions: Email info@atheycreek.com or call (971)327-2120</p>\n'),
	(12,7760,NULL,'Worship Services\r\nSaturday Night at 6:00 PM\r\nSunday Morning at 8:30 AM and 11:00 AM\r\nAthey Creek Christian Fellowship\r\n27520 SW 95th Ave\r\nWilsonville, OR 97070\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',NULL,'Worship Services\r\nSaturday Night at 6:00 PM\r\nSunday Morning at 8:30 AM and 11:00 AM\r\nAthey Creek Christian Fellowship\r\n27520 SW 95th Ave\r\nWilsonville, OR 97070\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',268,'<p>Worship Services\nSaturday Night at 6:00 PM\nSunday Morning at 8:30 AM and 11:00 AM\nAthey Creek Christian Fellowship\n27520 SW 95th Ave\nWilsonville, OR 97070</p>\n\n<p>Our Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.</p>\n\n<p>In John 4:23, Jesus says that the Father seeks those who will worship Him &#8216;in spirit and in truth.&#8217; With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that &#8220;all things be done decently, and in order&#8221; (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.</p>\n\n<p>While the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.</p>\n');
