INSERT INTO `sym_entries_data_40` (`id`, `entry_id`, `handle`, `value`, `handle-en`, `value-en`, `word_count-en`, `value_format-en`)
VALUES
	(5,45,NULL,'## What We Believe\r\n\r\n### The Athey Creek Christian Fellowship is a body of believers desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.\r\n\r\nWe believe there is one God who eternally exists in three persons: the Father, the Son and the Holy Spirit. We believe that Jesus Christ, the second person of the Holy Trinity, was born of a virgin, lived a sinless life, died a sacrificial death for the sins of the world, rose bodily from the dead, ascended into Heaven and is coming again to judge the living and the dead and to establish Gods kingdom of righteousness and peace on the earth.\r\n\r\nWe believe the only true basis of Christian fellowship is Gods love, which is greater than any differences we possess and without which we have no right to claim ourselves Christians.  \r\n*1 Corinthians 13*\r\n\r\nWe believe that salvation comes through Jesus alone. It is by His grace and work on the cross we can go to Heaven, not by any work we do.   \r\n*Ephesians 2:8-9*\r\n\r\nWe believe the marks of a maturing church are Faith, Hope and Love.  \r\n*Colossians 1:3-7*\r\n\r\nWe believe the Bible to be the inspired and inerrant Word of God. We place high emphasis on the teaching of Gods Word, the Bible, that our Faith may grow.   \r\n*Romans 10:17, 2 Timothy 3:16*\r\n\r\nWe live in anticipation of the return of Jesus, for He is our Blessed Hope.  \r\n*Titus 2:13*\r\n\r\nWe desire the fullness of the Spirit in our lives, for the fruit of the Spirit is Love.  \r\n*Galatians 5:22*',NULL,'## What We Believe\r\n\r\n### The Athey Creek Christian Fellowship is a body of believers desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.\r\n\r\nWe believe there is one God who eternally exists in three persons: the Father, the Son and the Holy Spirit. We believe that Jesus Christ, the second person of the Holy Trinity, was born of a virgin, lived a sinless life, died a sacrificial death for the sins of the world, rose bodily from the dead, ascended into Heaven and is coming again to judge the living and the dead and to establish Gods kingdom of righteousness and peace on the earth.\r\n\r\nWe believe the only true basis of Christian fellowship is Gods love, which is greater than any differences we possess and without which we have no right to claim ourselves Christians.  \r\n*1 Corinthians 13*\r\n\r\nWe believe that salvation comes through Jesus alone. It is by His grace and work on the cross we can go to Heaven, not by any work we do.   \r\n*Ephesians 2:8-9*\r\n\r\nWe believe the marks of a maturing church are Faith, Hope and Love.  \r\n*Colossians 1:3-7*\r\n\r\nWe believe the Bible to be the inspired and inerrant Word of God. We place high emphasis on the teaching of Gods Word, the Bible, that our Faith may grow.   \r\n*Romans 10:17, 2 Timothy 3:16*\r\n\r\nWe live in anticipation of the return of Jesus, for He is our Blessed Hope.  \r\n*Titus 2:13*\r\n\r\nWe desire the fullness of the Spirit in our lives, for the fruit of the Spirit is Love.  \r\n*Galatians 5:22*',262,'<h2>What We Believe</h2>\n\n<h3>The Athey Creek Christian Fellowship is a body of believers desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.</h3>\n\n<p>We believe there is one God who eternally exists in three persons: the Father, the Son and the Holy Spirit. We believe that Jesus Christ, the second person of the Holy Trinity, was born of a virgin, lived a sinless life, died a sacrificial death for the sins of the world, rose bodily from the dead, ascended into Heaven and is coming again to judge the living and the dead and to establish Gods kingdom of righteousness and peace on the earth.</p>\n\n<p>We believe the only true basis of Christian fellowship is Gods love, which is greater than any differences we possess and without which we have no right to claim ourselves Christians.<br />\n<em>1 Corinthians 13</em></p>\n\n<p>We believe that salvation comes through Jesus alone. It is by His grace and work on the cross we can go to Heaven, not by any work we do.<br />\n<em>Ephesians 2:8-9</em></p>\n\n<p>We believe the marks of a maturing church are Faith, Hope and Love.<br />\n<em>Colossians 1:3-7</em></p>\n\n<p>We believe the Bible to be the inspired and inerrant Word of God. We place high emphasis on the teaching of Gods Word, the Bible, that our Faith may grow.<br />\n<em>Romans 10:17, 2 Timothy 3:16</em></p>\n\n<p>We live in anticipation of the return of Jesus, for He is our Blessed Hope.<br />\n<em>Titus 2:13</em></p>\n\n<p>We desire the fullness of the Spirit in our lives, for the fruit of the Spirit is Love.<br />\n<em>Galatians 5:22</em></p>\n'),
	(13,47,NULL,'## Offering a refreshing look at what it means to be a godly woman\r\n\r\n\r\nOur approach to Womens Ministry at Athey Creek is rather simple.  In *Titus 2:3-5*, the Lord gives us a loving outline for godly living that is specifically directed to women.  We are blessed to have some wonderful older women in our fellowship who are willing to come alongside the younger women.  Much of this happens naturally as the women interact at church or various gatherings.  Relationships are formed and women grow as they learn from one another.  There are also opportunities for prayer, fellowship and getting into the Word at Bible studies and various events that take place throughout the year.  If you would like to know more about current Bible studies or upcoming events, please check the links listed below.\r\n\r\nJudy Slaughter oversees our Womens Ministry and she is available to meet with the women of our church who desire prayer, godly counsel or simply a time to fellowship.  Judy also leads many of the studies that we offer, and she enjoys seeing the Lord at work in the hearts and minds of the ladies at our church.  If you would like to meet with Judy, or if you have any questions about this ministry, please contact the church office at 971-327-2120. ',NULL,'## Offering a refreshing look at what it means to be a godly woman\r\n\r\n\r\nOur approach to Womens Ministry at Athey Creek is rather simple.  In *Titus 2:3-5*, the Lord gives us a loving outline for godly living that is specifically directed to women.  We are blessed to have some wonderful older women in our fellowship who are willing to come alongside the younger women.  Much of this happens naturally as the women interact at church or various gatherings.  Relationships are formed and women grow as they learn from one another.  There are also opportunities for prayer, fellowship and getting into the Word at Bible studies and various events that take place throughout the year.  If you would like to know more about current Bible studies or upcoming events, please check the links listed below.\r\n\r\nJudy Slaughter oversees our Womens Ministry and she is available to meet with the women of our church who desire prayer, godly counsel or simply a time to fellowship.  Judy also leads many of the studies that we offer, and she enjoys seeing the Lord at work in the hearts and minds of the ladies at our church.  If you would like to meet with Judy, or if you have any questions about this ministry, please contact the church office at 971-327-2120. ',214,'<h2>Offering a refreshing look at what it means to be a godly woman</h2>\n\n<p>Our approach to Womens Ministry at Athey Creek is rather simple.  In <em>Titus 2:3-5</em>, the Lord gives us a loving outline for godly living that is specifically directed to women.  We are blessed to have some wonderful older women in our fellowship who are willing to come alongside the younger women.  Much of this happens naturally as the women interact at church or various gatherings.  Relationships are formed and women grow as they learn from one another.  There are also opportunities for prayer, fellowship and getting into the Word at Bible studies and various events that take place throughout the year.  If you would like to know more about current Bible studies or upcoming events, please check the links listed below.</p>\n\n<p>Judy Slaughter oversees our Womens Ministry and she is available to meet with the women of our church who desire prayer, godly counsel or simply a time to fellowship.  Judy also leads many of the studies that we offer, and she enjoys seeing the Lord at work in the hearts and minds of the ladies at our church.  If you would like to meet with Judy, or if you have any questions about this ministry, please contact the church office at 971-327-2120.</p>\n'),
	(14,49,NULL,'## Becoming a man after God\'s own heart\r\n\r\nThe worlds definition of manhood is distorted, to say the least.  The roles of men have been undermined and confused to the extent that many men are left wondering what it really means to be a good man.  The great news is that the Lord has much to say on this subject.  The Bible is full of practical instruction on how to be a godly man.  Marriages will be built up as men learn how to really love their wives.  Children will grow up knowing the Lord as men take on the responsibility of leading their families.  Every relationship in a mans life  his family, his work, his friendships  is strengthened and solidified as he grows in the most important relationship, which is his relationship with Jesus Christ. \r\n\r\nAs hearts and minds are renewed by the Word, lives are impacted and changed.  The guys of our church will become effective tools in the Lords hand as we reflect His glory and His character.  A man who can live out a life of faith and conviction will undoubtedly shine Jesus love in a lost world.\r\n\r\nIf you have any questions about our Mens Ministry, please contact Bryn Ritchie at 503-360-5203.\r\n',NULL,'## Becoming a man after God\'s own heart\r\n\r\nThe worlds definition of manhood is distorted, to say the least.  The roles of men have been undermined and confused to the extent that many men are left wondering what it really means to be a good man.  The great news is that the Lord has much to say on this subject.  The Bible is full of practical instruction on how to be a godly man.  Marriages will be built up as men learn how to really love their wives.  Children will grow up knowing the Lord as men take on the responsibility of leading their families.  Every relationship in a mans life  his family, his work, his friendships  is strengthened and solidified as he grows in the most important relationship, which is his relationship with Jesus Christ. \r\n\r\nAs hearts and minds are renewed by the Word, lives are impacted and changed.  The guys of our church will become effective tools in the Lords hand as we reflect His glory and His character.  A man who can live out a life of faith and conviction will undoubtedly shine Jesus love in a lost world.\r\n\r\nIf you have any questions about our Mens Ministry, please contact Bryn Ritchie at 503-360-5203.\r\n',205,'<h2>Becoming a man after God&#8217;s own heart</h2>\n\n<p>The worlds definition of manhood is distorted, to say the least.  The roles of men have been undermined and confused to the extent that many men are left wondering what it really means to be a good man.  The great news is that the Lord has much to say on this subject.  The Bible is full of practical instruction on how to be a godly man.  Marriages will be built up as men learn how to really love their wives.  Children will grow up knowing the Lord as men take on the responsibility of leading their families.  Every relationship in a mans life  his family, his work, his friendships  is strengthened and solidified as he grows in the most important relationship, which is his relationship with Jesus Christ.</p>\n\n<p>As hearts and minds are renewed by the Word, lives are impacted and changed.  The guys of our church will become effective tools in the Lords hand as we reflect His glory and His character.  A man who can live out a life of faith and conviction will undoubtedly shine Jesus love in a lost world.</p>\n\n<p>If you have any questions about our Mens Ministry, please contact Bryn Ritchie at 503-360-5203.</p>\n'),
	(15,50,NULL,'## Growing closer in our walks with Jesus\r\n\r\nWhether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him. \r\n\r\nDavid & Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College & Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.\r\n',NULL,'## Growing closer in our walks with Jesus\r\n\r\nWhether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him. \r\n\r\nDavid & Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College & Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.\r\n',138,'<h2>Growing closer in our walks with Jesus</h2>\n\n<p>Whether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him.</p>\n\n<p>David &amp; Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College &amp; Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.</p>\n'),
	(16,51,NULL,'The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.\r\n\r\nFellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus. \r\n\r\nTake a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don\'t forget to check out the High School Ministry\'s very own website on the side of the page!\r\n\r\nIf you have any questions, contact Abe Menshenfriend at (971)222-9586.',NULL,'The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.\r\n\r\nFellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus. \r\n\r\nTake a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don\'t forget to check out the High School Ministry\'s very own website on the side of the page!\r\n\r\nIf you have any questions, contact Abe Menshenfriend at (971)222-9586.',196,'<p>The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.</p>\n\n<p>Fellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus.</p>\n\n<p>Take a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don&#8217;t forget to check out the High School Ministry&#8217;s very own website on the side of the page!</p>\n\n<p>If you have any questions, contact Abe Menshenfriend at (971)222-9586.</p>\n'),
	(17,52,NULL,'Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \r\nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!\r\n\r\nIf you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!\r\n\r\nIf you have any questions, you can contact Seth at (503) 984-6605.',NULL,'Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \r\nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!\r\n\r\nIf you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!\r\n\r\nIf you have any questions, you can contact Seth at (503) 984-6605.',122,'<p>Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!</p>\n\n<p>If you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!</p>\n\n<p>If you have any questions, you can contact Seth at (503) 984-6605.</p>\n'),
	(18,53,NULL,'## Caring for the kids of our Fellowship\r\n\r\nThanks for checking out our Childrens Ministry web page.  The Lord has blessed us with a great bunch of kids at Athey Creek.  We enjoy sharing the love of Jesus with them in a safe and secure environment.  Feel free to click on the links on this page to get a better understanding of childrens ministry at Athey Creek.\r\n\r\nGod bless you,\r\n\r\nJames',NULL,'## Caring for the kids of our Fellowship\r\n\r\nThanks for checking out our Childrens Ministry web page.  The Lord has blessed us with a great bunch of kids at Athey Creek.  We enjoy sharing the love of Jesus with them in a safe and secure environment.  Feel free to click on the links on this page to get a better understanding of childrens ministry at Athey Creek.\r\n\r\nGod bless you,\r\n\r\nJames',70,'<h2>Caring for the kids of our Fellowship</h2>\n\n<p>Thanks for checking out our Childrens Ministry web page.  The Lord has blessed us with a great bunch of kids at Athey Creek.  We enjoy sharing the love of Jesus with them in a safe and secure environment.  Feel free to click on the links on this page to get a better understanding of childrens ministry at Athey Creek.</p>\n\n<p>God bless you,</p>\n\n<p>James</p>\n'),
	(19,54,NULL,'## Mission Work at Athey\r\n\r\nWe have been blessed with the love and goodness of the Lord here at Athey Creek. In response to this, many at Athey have naturally been motivated to step out in faith into a variety of mission fields  in Portland, throughout the U.S., and around the world. The Lord has opened up some amazing opportunities.\r\n\r\nThere are many ways to participate in mission work around the world. Through prayer, through giving, or through your own participation on a mission trip, it is wonderful to see the Great Commission in action! For some of us, our greatest mission field will be our families, or our neighbors, or perhaps someone at work. Jesus said, The field is white unto harvest. What a blessing it is that He allows us to be a part of the growing of His kingdom. We hope that you are encouraged as you fulfill the role He has ordained for you in this!\r\n\r\nChoose a mission from the right column to learn more about it. If you have any additional questions on our missions involvement contact the church office.',NULL,'## Mission Work at Athey\r\n\r\nWe have been blessed with the love and goodness of the Lord here at Athey Creek. In response to this, many at Athey have naturally been motivated to step out in faith into a variety of mission fields  in Portland, throughout the U.S., and around the world. The Lord has opened up some amazing opportunities.\r\n\r\nThere are many ways to participate in mission work around the world. Through prayer, through giving, or through your own participation on a mission trip, it is wonderful to see the Great Commission in action! For some of us, our greatest mission field will be our families, or our neighbors, or perhaps someone at work. Jesus said, The field is white unto harvest. What a blessing it is that He allows us to be a part of the growing of His kingdom. We hope that you are encouraged as you fulfill the role He has ordained for you in this!\r\n\r\nChoose a mission from the right column to learn more about it. If you have any additional questions on our missions involvement contact the church office.',185,'<h2>Mission Work at Athey</h2>\n\n<p>We have been blessed with the love and goodness of the Lord here at Athey Creek. In response to this, many at Athey have naturally been motivated to step out in faith into a variety of mission fields  in Portland, throughout the U.S., and around the world. The Lord has opened up some amazing opportunities.</p>\n\n<p>There are many ways to participate in mission work around the world. Through prayer, through giving, or through your own participation on a mission trip, it is wonderful to see the Great Commission in action! For some of us, our greatest mission field will be our families, or our neighbors, or perhaps someone at work. Jesus said, The field is white unto harvest. What a blessing it is that He allows us to be a part of the growing of His kingdom. We hope that you are encouraged as you fulfill the role He has ordained for you in this!</p>\n\n<p>Choose a mission from the right column to learn more about it. If you have any additional questions on our missions involvement contact the church office.</p>\n'),
	(20,56,NULL,'The Bulletin Board is a way for people to post information about Bible studies they are holding, classes they are leading and gatherings of all kinds that are taking place among the body of ACCF.  Our hope is that this encourages ventures of faith as people step out to do what the Lord has laid on their hearts in the way of Bible studies, service projects and times of fellowship.  To help facilitate this, this Bulletin Board is available to help you get the word out.',NULL,'The Bulletin Board is a way for people to post information about Bible studies they are holding, classes they are leading and gatherings of all kinds that are taking place among the body of ACCF.  Our hope is that this encourages ventures of faith as people step out to do what the Lord has laid on their hearts in the way of Bible studies, service projects and times of fellowship.  To help facilitate this, this Bulletin Board is available to help you get the word out.',86,'<p>The Bulletin Board is a way for people to post information about Bible studies they are holding, classes they are leading and gatherings of all kinds that are taking place among the body of ACCF.  Our hope is that this encourages ventures of faith as people step out to do what the Lord has laid on their hearts in the way of Bible studies, service projects and times of fellowship.  To help facilitate this, this Bulletin Board is available to help you get the word out.</p>\n'),
	(21,71,NULL,'Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \r\nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!\r\n\r\nIf you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!\r\n\r\nIf you have any questions, you can contact Nate.',NULL,'Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \r\nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!\r\n\r\nIf you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!\r\n\r\nIf you have any questions, you can contact Nate.',121,'<p>Our goal in the Jr. High Ministry is to worship the Lord, study the Bible and enjoy great fellowship. Whether were meeting on a Wednesday night or on one of our many trips, we always have an awesome time. \nAs we study through the Bible, we learn what Jesus has done for us and how we should live our lives for Him. Come ready to worship the Lord, dig into the Word and have tons of crazy fun!</p>\n\n<p>If you would like information on Bible Studies and Upcoming Events, check out the links below.  You can also visit the Jr. High Blog to see the latest pictures from recent Jr. High activities!</p>\n\n<p>If you have any questions, you can contact Nate.</p>\n'),
	(22,72,NULL,'The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.\r\n\r\nFellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus. \r\n\r\nTake a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don\'t forget to check out the High School Ministry\'s very own website on the side of the page!\r\n\r\nIf you have any questions, contact Abe Menshenfriend at (971)222-9586.',NULL,'The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.\r\n\r\nFellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus. \r\n\r\nTake a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don\'t forget to check out the High School Ministry\'s very own website on the side of the page!\r\n\r\nIf you have any questions, contact Abe Menshenfriend at (971)222-9586.',196,'<p>The vision for our High School ministry is simply this: to know Jesus.  We get together each week to learn more about the person of Jesus and the impact He wants to make in our lives.  Through time spent in worship, in prayer and in studying His Word, He becomes more and more personal to each one of us.  This is the whole reason we get together every Thursday night.</p>\n\n<p>Fellowship is an important part of what we do as well.  It is a huge blessing to have Christian friends walking this same path with us. The trips and events we do are always fun and a little crazy, but even these times are geared around the same purpose of knowing Jesus better.  So whether were on a snowy mountain or hanging out at the beach, we always have time to open up the Bible and learn more about Jesus.</p>\n\n<p>Take a look at the Bible Studies and Upcoming Events links below to see whats happening right now. Also, don&#8217;t forget to check out the High School Ministry&#8217;s very own website on the side of the page!</p>\n\n<p>If you have any questions, contact Abe Menshenfriend at (971)222-9586.</p>\n'),
	(23,73,NULL,'## Growing closer in our walks with Jesus\r\n\r\nWhether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him. \r\n\r\nDavid & Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College & Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.\r\n',NULL,'## Growing closer in our walks with Jesus\r\n\r\nWhether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him. \r\n\r\nDavid & Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College & Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.\r\n',138,'<h2>Growing closer in our walks with Jesus</h2>\n\n<p>Whether you are up to your eyeballs in homework, or simply grinding away in the work force, we want to provide a place for you to come away and be renewed.  If you are 18-24 years of age, we invite you to join us on Tuesday nights for a time of worship, prayer and the study of Gods Word.  At a time when many people are falling into worldly thinking and behavior, we want to see our young adults growing in their knowledge of the Lord and in their relationships with Him.</p>\n\n<p>David &amp; Becca Frost lead this ministry.  If you have any questions about Tuesday nights, or the various College &amp; Career events, you can contact David at 503-781-1459.  Or you can click on the links below for more information about studies and activities.</p>\n'),
	(30,77,NULL,'### Saturday at 6:00 PM\r\n### Sunday at 8:30 AM and 11:00 AM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',NULL,'### Saturday at 6:00 PM\r\n### Sunday at 8:30 AM and 11:00 AM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nOur Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.\r\n\r\nIn John 4:23, Jesus says that the Father seeks those who will worship Him \'in spirit and in truth.\' With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that \"all things be done decently, and in order\" (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.\r\n\r\nWhile the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.',264,'<h3>Saturday at 6:00 PM</h3>\n\n<h3>Sunday at 8:30 AM and 11:00 AM</h3>\n\n<h4>Athey Creek Christian Fellowship</h4>\n\n<h4>27520 SW 95th Ave</h4>\n\n<h4>Wilsonville, OR 97070</h4>\n\n<p>Our Saturday night and Sunday morning services are identical to one another. Like much of what we do at Athey, they are simple and casual. Acts 2:42 offers a clear description of what the early church was like. It is our desire to follow this model as closely as possible. Pastor Brett teaches book-by-book through the Bible. In these weekend worship services, the teaching usually highlights a particular verse or section from the upcoming midweek study.</p>\n\n<p>In John 4:23, Jesus says that the Father seeks those who will worship Him &#8216;in spirit and in truth.&#8217; With this in mind, we endeavor to worship expressively and sincerely. Many of our songs are taken directly from passages of Scripture. The Word also directs that &#8220;all things be done decently, and in order&#8221; (I Corinthians 14:40). We desire to make Saturday Nights and Sunday mornings a time where you can feel comfortable bringing friends and family who may not know the Lord.</p>\n\n<p>While the adults are studying through the Word, our kids are being taught as well. We invite you take advantage of our childrens ministry program. We have found that the kids have more fun in their classes, learning about Jesus and playing with other kids, than sitting through the service. This way, parents are able to take in the Word without distraction and kids are able to learn in an age-appropriate environment. On Saturday nights and Sunday mornings we provide childcare during all of our services for infants through grade school.</p>\n'),
	(31,79,NULL,'## Going deeper into God\'s Word\r\n\r\n### Wednesday at 7:00 PM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nWednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.\r\n\r\nDuring this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.',NULL,'## Going deeper into God\'s Word\r\n\r\n### Wednesday at 7:00 PM\r\n#### Athey Creek Christian Fellowship\r\n#### 27520 SW 95th Ave\r\n#### Wilsonville, OR 97070\r\n\r\nWednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.\r\n\r\nDuring this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.',106,'<h2>Going deeper into God&#8217;s Word</h2>\n\n<h3>Wednesday at 7:00 PM</h3>\n\n<h4>Athey Creek Christian Fellowship</h4>\n\n<h4>27520 SW 95th Ave</h4>\n\n<h4>Wilsonville, OR 97070</h4>\n\n<p>Wednesday nights are a time to grow in knowledge and understanding of the Word. We dig in with a verse-by-verse, chapter-by-chapter study of the Bible. Bring your Bible, a notebook and a heart ready to hear from the Lord.</p>\n\n<p>During this time, we have classes for our children, from infants through fifth grade. Our Junior High group meets for time in the Word, worship and loads of fun! For information on other studies, such as the High School group, or our College group, please refer to our ministries page.</p>\n'),
	(41,90,NULL,'##Ouagadougou, Burkina Faso\r\n\r\n###Daniel and Elizabeth Delma\r\n\r\nIn 1993, years before ACCF had even begun, the Lord allowed Pastor Brett to travel to Burkina Faso to teach at a pastors conference.  In his time there, some long-lasting friendships were established, which the Lord has continued to bless.  One such friend is Pastor Daniel Delma.  Pastor Daniel shepherds a church on the outskirts of the city of Ouagadougou.  Through the church, Daniel and his wife minister to the widows in the area by providing for the basic needs of these ladies and their children.  Daniel also spends much of his time leading and teaching pastors throughout the country.  He is working with another good friend and brother of ACCF, pastor Marcel Yanogo, to instruct pastors throughout Burkina Faso in how to teach through Gods Word verse-by-verse.  We are blessed to play a small role in the ministries of Daniel, Marcel, and many other Burkinabe pastors as we have had the opportunity to send Athey Creekers over to minister with them in pastors conferences, kids camps and other ministry opportunities.\r\n\r\nPrayer Requests:\r\n\r\nThe Lord continues to bless the people of Burkina as His Spirit moves throughout the country spreading the Good News of His salvation. Please join with us in praying that the Lord would raise up men throughout Burkina Faso to teach His Word.  May the Lord continue to send teachers to help train these men as they minister.  There is also a constant need for the provision of rain for the crops so that the people might have food and healthy drinking water.  As a result of consistent famine and disease, prayer for the Lords healing is always needed.  Thank you so much for your prayers.  We are blessed by the Lords continued provision and covering and we look forward to ministering together with you for many years to come.',NULL,'##Ouagadougou, Burkina Faso\r\n\r\n###Daniel and Elizabeth Delma\r\n\r\nIn 1993, years before ACCF had even begun, the Lord allowed Pastor Brett to travel to Burkina Faso to teach at a pastors conference.  In his time there, some long-lasting friendships were established, which the Lord has continued to bless.  One such friend is Pastor Daniel Delma.  Pastor Daniel shepherds a church on the outskirts of the city of Ouagadougou.  Through the church, Daniel and his wife minister to the widows in the area by providing for the basic needs of these ladies and their children.  Daniel also spends much of his time leading and teaching pastors throughout the country.  He is working with another good friend and brother of ACCF, pastor Marcel Yanogo, to instruct pastors throughout Burkina Faso in how to teach through Gods Word verse-by-verse.  We are blessed to play a small role in the ministries of Daniel, Marcel, and many other Burkinabe pastors as we have had the opportunity to send Athey Creekers over to minister with them in pastors conferences, kids camps and other ministry opportunities.\r\n\r\nPrayer Requests:\r\n\r\nThe Lord continues to bless the people of Burkina as His Spirit moves throughout the country spreading the Good News of His salvation. Please join with us in praying that the Lord would raise up men throughout Burkina Faso to teach His Word.  May the Lord continue to send teachers to help train these men as they minister.  There is also a constant need for the provision of rain for the crops so that the people might have food and healthy drinking water.  As a result of consistent famine and disease, prayer for the Lords healing is always needed.  Thank you so much for your prayers.  We are blessed by the Lords continued provision and covering and we look forward to ministering together with you for many years to come.',309,'<h2>Ouagadougou, Burkina Faso</h2>\n\n<h3>Daniel and Elizabeth Delma</h3>\n\n<p>In 1993, years before ACCF had even begun, the Lord allowed Pastor Brett to travel to Burkina Faso to teach at a pastors conference.  In his time there, some long-lasting friendships were established, which the Lord has continued to bless.  One such friend is Pastor Daniel Delma.  Pastor Daniel shepherds a church on the outskirts of the city of Ouagadougou.  Through the church, Daniel and his wife minister to the widows in the area by providing for the basic needs of these ladies and their children.  Daniel also spends much of his time leading and teaching pastors throughout the country.  He is working with another good friend and brother of ACCF, pastor Marcel Yanogo, to instruct pastors throughout Burkina Faso in how to teach through Gods Word verse-by-verse.  We are blessed to play a small role in the ministries of Daniel, Marcel, and many other Burkinabe pastors as we have had the opportunity to send Athey Creekers over to minister with them in pastors conferences, kids camps and other ministry opportunities.</p>\n\n<p>Prayer Requests:</p>\n\n<p>The Lord continues to bless the people of Burkina as His Spirit moves throughout the country spreading the Good News of His salvation. Please join with us in praying that the Lord would raise up men throughout Burkina Faso to teach His Word.  May the Lord continue to send teachers to help train these men as they minister.  There is also a constant need for the provision of rain for the crops so that the people might have food and healthy drinking water.  As a result of consistent famine and disease, prayer for the Lords healing is always needed.  Thank you so much for your prayers.  We are blessed by the Lords continued provision and covering and we look forward to ministering together with you for many years to come.</p>\n'),
	(42,89,NULL,'##Brazil\r\n\r\n###Mike & Kelli Anderson\r\n###Emily 3 and Lydia 1 & 1/2\r\n\r\n\r\nMike and Kelli are working with Wycliffe as Bible translators in Brazil. Three years ago, they moved to Brazil, hoping to translate Gods Word into an indigenous language.  They are building relationships in the communities and connecting with people in an effort to learn this intricate new language.  Athey Creek Christian Fellowship is glad to support them prayerfully and financially. Last year they traveled to Dallas, Texas for a delicate skull surgery for their youngest daughter.  While she was recovering, they also took a few linguistics courses, and are now back in Brazil.\r\n\r\nPrayer Requests:\r\n\r\nWe praise the Lord for your continued prayers and for the opportunity to share our ministry with you.  We are excited to be back in Brazil despite a hard first term, and to be starting fresh in new jump-off town. We also praise Him for Lydias successful craniosynostosis surgery while in the States!',NULL,'##Brazil\r\n\r\n###Mike & Kelli Anderson\r\n###Emily 3 and Lydia 1 & 1/2\r\n\r\n\r\nMike and Kelli are working with Wycliffe as Bible translators in Brazil. Three years ago, they moved to Brazil, hoping to translate Gods Word into an indigenous language.  They are building relationships in the communities and connecting with people in an effort to learn this intricate new language.  Athey Creek Christian Fellowship is glad to support them prayerfully and financially. Last year they traveled to Dallas, Texas for a delicate skull surgery for their youngest daughter.  While she was recovering, they also took a few linguistics courses, and are now back in Brazil.\r\n\r\nPrayer Requests:\r\n\r\nWe praise the Lord for your continued prayers and for the opportunity to share our ministry with you.  We are excited to be back in Brazil despite a hard first term, and to be starting fresh in new jump-off town. We also praise Him for Lydias successful craniosynostosis surgery while in the States!',155,'<h2>Brazil</h2>\n\n<h3>Mike &amp; Kelli Anderson</h3>\n\n<h3>Emily 3 and Lydia 1 &amp; 1/2</h3>\n\n<p>Mike and Kelli are working with Wycliffe as Bible translators in Brazil. Three years ago, they moved to Brazil, hoping to translate Gods Word into an indigenous language.  They are building relationships in the communities and connecting with people in an effort to learn this intricate new language.  Athey Creek Christian Fellowship is glad to support them prayerfully and financially. Last year they traveled to Dallas, Texas for a delicate skull surgery for their youngest daughter.  While she was recovering, they also took a few linguistics courses, and are now back in Brazil.</p>\n\n<p>Prayer Requests:</p>\n\n<p>We praise the Lord for your continued prayers and for the opportunity to share our ministry with you.  We are excited to be back in Brazil despite a hard first term, and to be starting fresh in new jump-off town. We also praise Him for Lydias successful craniosynostosis surgery while in the States!</p>\n'),
	(43,91,NULL,'##Lima, Peru\r\n\r\n###Gino and Darci Canesssa\r\n\r\nLima is the large, heavily populated, capital city of Peru.  It is predominantly Catholic, and the country is filled with people imprisoned by empty, repetitious customs.  We are currently ministering in three distinct areas inside of Lima, one where we live in the city (Magdalena) and two in the outskirts (Ventanilla and Pachacutec).  The outlying areas of Lima are extremely poverty-stricken with houses built into the dirt hillsides.  The physical hunger in Lima is only surpassed by a spiritual hunger.  So we are continually pointing people to Jesus, and He has been faithful to open doors to share Him with people!  We are involved with ministries for children and youth (teaching and outreach), discipleship of Calvary Chapel Bible College students and young men & women of Lima, teaching at the Bible college and ministering at the Calvary Chapel Church of Magdalena.\r\n\r\n   \r\n\r\nPrayer Requests:\r\n\r\nPraise Jesus because He is so good!  We cannot do anything without Him.  We thank you for praying for us!  We ask that you would join us in praying for the following:\r\n That Jesus would always be the center of our marriage and our home\r\nThat it would always be Jesus who ministers through us\r\n That we would be filled with and guided by the Holy Spirit\r\n Darcis health\r\n Ginos teachings throughout the week\r\n That God would reach His people and transform their lives for His glory\r\n For the many youth and kids that we are ministering to',NULL,'##Lima, Peru\r\n\r\n###Gino and Darci Canesssa\r\n\r\nLima is the large, heavily populated, capital city of Peru.  It is predominantly Catholic, and the country is filled with people imprisoned by empty, repetitious customs.  We are currently ministering in three distinct areas inside of Lima, one where we live in the city (Magdalena) and two in the outskirts (Ventanilla and Pachacutec).  The outlying areas of Lima are extremely poverty-stricken with houses built into the dirt hillsides.  The physical hunger in Lima is only surpassed by a spiritual hunger.  So we are continually pointing people to Jesus, and He has been faithful to open doors to share Him with people!  We are involved with ministries for children and youth (teaching and outreach), discipleship of Calvary Chapel Bible College students and young men & women of Lima, teaching at the Bible college and ministering at the Calvary Chapel Church of Magdalena.\r\n\r\n   \r\n\r\nPrayer Requests:\r\n\r\nPraise Jesus because He is so good!  We cannot do anything without Him.  We thank you for praying for us!  We ask that you would join us in praying for the following:\r\n That Jesus would always be the center of our marriage and our home\r\nThat it would always be Jesus who ministers through us\r\n That we would be filled with and guided by the Holy Spirit\r\n Darcis health\r\n Ginos teachings throughout the week\r\n That God would reach His people and transform their lives for His glory\r\n For the many youth and kids that we are ministering to',246,'<h2>Lima, Peru</h2>\n\n<h3>Gino and Darci Canesssa</h3>\n\n<p>Lima is the large, heavily populated, capital city of Peru.  It is predominantly Catholic, and the country is filled with people imprisoned by empty, repetitious customs.  We are currently ministering in three distinct areas inside of Lima, one where we live in the city (Magdalena) and two in the outskirts (Ventanilla and Pachacutec).  The outlying areas of Lima are extremely poverty-stricken with houses built into the dirt hillsides.  The physical hunger in Lima is only surpassed by a spiritual hunger.  So we are continually pointing people to Jesus, and He has been faithful to open doors to share Him with people!  We are involved with ministries for children and youth (teaching and outreach), discipleship of Calvary Chapel Bible College students and young men &amp; women of Lima, teaching at the Bible college and ministering at the Calvary Chapel Church of Magdalena.</p>\n\n<p>Prayer Requests:</p>\n\n<p>Praise Jesus because He is so good!  We cannot do anything without Him.  We thank you for praying for us!  We ask that you would join us in praying for the following:\n That Jesus would always be the center of our marriage and our home\nThat it would always be Jesus who ministers through us\n That we would be filled with and guided by the Holy Spirit\n Darcis health\n Ginos teachings throughout the week\n That God would reach His people and transform their lives for His glory\n For the many youth and kids that we are ministering to</p>\n'),
	(50,95,NULL,'##Kampala, Uganda##\r\n\r\n###Randy and Alisa Varga###           \r\n###Josh, Eli and Gabe###\r\n\r\n\r\nRandy and Alisa are in Kampala Uganda to help serve at a mission base. Their vision is to share the gospel, to love on the kids and to be a godly example for those they will encounter in Uganda. The Vargas will primarily be serving at Hope Christian Home, a big facility that houses and feeds several hundred orphans. In addition to serving at the mission they hope to share the gospel anywhere from prisons, to radio stations, to the streets of Uganda. Currently Randy, a contractor himself, is helping with the construction of a new building project called the Field of Dreams which will be able to house more missionaries and orphans.\r\n\r\n\r\nPrayer Requests:\r\n\r\nHey church family! We have been so blessed to be a part of Athey and are really excited to be in Uganda to do Gods work! We thank you deeply for your prayers and are glad to know that the Lords work is done in Wilsonville as well as in Uganda.\r\n',NULL,'##Kampala, Uganda##\r\n\r\n###Randy and Alisa Varga###           \r\n###Josh, Eli and Gabe###\r\n\r\n\r\nRandy and Alisa are in Kampala Uganda to help serve at a mission base. Their vision is to share the gospel, to love on the kids and to be a godly example for those they will encounter in Uganda. The Vargas will primarily be serving at Hope Christian Home, a big facility that houses and feeds several hundred orphans. In addition to serving at the mission they hope to share the gospel anywhere from prisons, to radio stations, to the streets of Uganda. Currently Randy, a contractor himself, is helping with the construction of a new building project called the Field of Dreams which will be able to house more missionaries and orphans.\r\n\r\n\r\nPrayer Requests:\r\n\r\nHey church family! We have been so blessed to be a part of Athey and are really excited to be in Uganda to do Gods work! We thank you deeply for your prayers and are glad to know that the Lords work is done in Wilsonville as well as in Uganda.\r\n',176,'<h2>Kampala, Uganda</h2>\n\n<h3>Randy and Alisa Varga</h3>\n\n<h3>Josh, Eli and Gabe</h3>\n\n<p>Randy and Alisa are in Kampala Uganda to help serve at a mission base. Their vision is to share the gospel, to love on the kids and to be a godly example for those they will encounter in Uganda. The Vargas will primarily be serving at Hope Christian Home, a big facility that houses and feeds several hundred orphans. In addition to serving at the mission they hope to share the gospel anywhere from prisons, to radio stations, to the streets of Uganda. Currently Randy, a contractor himself, is helping with the construction of a new building project called the Field of Dreams which will be able to house more missionaries and orphans.</p>\n\n<p>Prayer Requests:</p>\n\n<p>Hey church family! We have been so blessed to be a part of Athey and are really excited to be in Uganda to do Gods work! We thank you deeply for your prayers and are glad to know that the Lords work is done in Wilsonville as well as in Uganda.</p>\n'),
	(52,97,NULL,'##The Islands of Vanuatu##\r\n\r\n###Tad and Marna Slaughter\r\n###Joel (Wheaton), Amy (Wheaton) and John###\r\n\r\nThe Islands of Vanuatu are located in the South Pacific west of Fiji.  In the late 1800s the first missionaries came to these fierce cannibalistic islands.  In an amazingly brief space of time many became Christians with entire populations of some islands coming to Christ.  In spite of this, there is little teaching through the Bible today.  Consequently, there is a huge hunger for the Word and many opportunities for sharing with people.  Our work is to help people know Jesus and love Him more as a result of learning who He is through the study of His Word. \r\n\r\nPrayer Requests:\r\n\r\nThe Lord has been adding to and blessing the church here, for which we are thankful.  We are also thankful for the Lords constant provision of everything we need - wisdom, direction and daily necessities.  Please pray that the Lord would provide safe transportation for the new people who have begun to attend the fellowship (our truck is simply not enough), and that the people coming to church would truly comprehend Gods grace and mercy in their lives.  Pray for discernment that we would know which of the open doors the Lord has for US since there are so many possibilities! ',NULL,'##The Islands of Vanuatu##\r\n\r\n###Tad and Marna Slaughter\r\n###Joel (Wheaton), Amy (Wheaton) and John###\r\n\r\nThe Islands of Vanuatu are located in the South Pacific west of Fiji.  In the late 1800s the first missionaries came to these fierce cannibalistic islands.  In an amazingly brief space of time many became Christians with entire populations of some islands coming to Christ.  In spite of this, there is little teaching through the Bible today.  Consequently, there is a huge hunger for the Word and many opportunities for sharing with people.  Our work is to help people know Jesus and love Him more as a result of learning who He is through the study of His Word. \r\n\r\nPrayer Requests:\r\n\r\nThe Lord has been adding to and blessing the church here, for which we are thankful.  We are also thankful for the Lords constant provision of everything we need - wisdom, direction and daily necessities.  Please pray that the Lord would provide safe transportation for the new people who have begun to attend the fellowship (our truck is simply not enough), and that the people coming to church would truly comprehend Gods grace and mercy in their lives.  Pray for discernment that we would know which of the open doors the Lord has for US since there are so many possibilities! ',215,'<h2>The Islands of Vanuatu</h2>\n\n<h3>Tad and Marna Slaughter</h3>\n\n<h3>Joel (Wheaton), Amy (Wheaton) and John</h3>\n\n<p>The Islands of Vanuatu are located in the South Pacific west of Fiji.  In the late 1800s the first missionaries came to these fierce cannibalistic islands.  In an amazingly brief space of time many became Christians with entire populations of some islands coming to Christ.  In spite of this, there is little teaching through the Bible today.  Consequently, there is a huge hunger for the Word and many opportunities for sharing with people.  Our work is to help people know Jesus and love Him more as a result of learning who He is through the study of His Word.</p>\n\n<p>Prayer Requests:</p>\n\n<p>The Lord has been adding to and blessing the church here, for which we are thankful.  We are also thankful for the Lords constant provision of everything we need - wisdom, direction and daily necessities.  Please pray that the Lord would provide safe transportation for the new people who have begun to attend the fellowship (our truck is simply not enough), and that the people coming to church would truly comprehend Gods grace and mercy in their lives.  Pray for discernment that we would know which of the open doors the Lord has for US since there are so many possibilities!</p>\n'),
	(53,93,NULL,'##Holsbybrunn, Sweden##\r\n\r\n###Jesse & Krista Ashmen###\r\n###Eleri 2###\r\n\r\nWe are missionaries with Torchbearers in Holsbybrunn, Sweden. We live on campus with 50 students who have come to learn more about what it means to be a Christ-follower. Students come from all over the world and are taught by both resident lecturers (like Jesse) and guest lecturers that fly in from different parts of the world. At Holsby, were involved with outreaches to the local and greater community. Most recently we led a mission trip to Gteborg, which was an incredible experience. We are very thankful for the life and opportunities God has given us. We hope to continue making a difference in the lives He sends our way. \r\n\r\n\r\nPrayer Requests:\r\n\r\nFor our ministry:\r\nPlease be praying that the Lord would continue to bring willing and eager students despite the worldwide economic recession.\r\nWe have a need for able short-term staff members willing to serve in maintenance, hospitality or an adventure team.  Please pray that the Lord provides the right people for these roles.\r\nOur campus will serve as the holiday grounds for nearly 1,000 Swedes during one of our biggest Scandinavian holidays  Midsomer.  Join us in praying for the logistics, which can be challenging, as well our opportunity to reach out to these listeners as many of them have no relationship with the Lord.\r\nFor us personally:\r\nWe have been blessed with our first child, Eleri.  Like all new parents, we need prayer for wisdom, patience and love for our little girl. ',NULL,'##Holsbybrunn, Sweden##\r\n\r\n###Jesse & Krista Ashmen###\r\n###Eleri 2###\r\n\r\nWe are missionaries with Torchbearers in Holsbybrunn, Sweden. We live on campus with 50 students who have come to learn more about what it means to be a Christ-follower. Students come from all over the world and are taught by both resident lecturers (like Jesse) and guest lecturers that fly in from different parts of the world. At Holsby, were involved with outreaches to the local and greater community. Most recently we led a mission trip to Gteborg, which was an incredible experience. We are very thankful for the life and opportunities God has given us. We hope to continue making a difference in the lives He sends our way. \r\n\r\n\r\nPrayer Requests:\r\n\r\nFor our ministry:\r\nPlease be praying that the Lord would continue to bring willing and eager students despite the worldwide economic recession.\r\nWe have a need for able short-term staff members willing to serve in maintenance, hospitality or an adventure team.  Please pray that the Lord provides the right people for these roles.\r\nOur campus will serve as the holiday grounds for nearly 1,000 Swedes during one of our biggest Scandinavian holidays  Midsomer.  Join us in praying for the logistics, which can be challenging, as well our opportunity to reach out to these listeners as many of them have no relationship with the Lord.\r\nFor us personally:\r\nWe have been blessed with our first child, Eleri.  Like all new parents, we need prayer for wisdom, patience and love for our little girl. ',248,'<h2>Holsbybrunn, Sweden</h2>\n\n<h3>Jesse &amp; Krista Ashmen</h3>\n\n<h3>Eleri 2</h3>\n\n<p>We are missionaries with Torchbearers in Holsbybrunn, Sweden. We live on campus with 50 students who have come to learn more about what it means to be a Christ-follower. Students come from all over the world and are taught by both resident lecturers (like Jesse) and guest lecturers that fly in from different parts of the world. At Holsby, were involved with outreaches to the local and greater community. Most recently we led a mission trip to Gteborg, which was an incredible experience. We are very thankful for the life and opportunities God has given us. We hope to continue making a difference in the lives He sends our way.</p>\n\n<p>Prayer Requests:</p>\n\n<p>For our ministry:\nPlease be praying that the Lord would continue to bring willing and eager students despite the worldwide economic recession.\nWe have a need for able short-term staff members willing to serve in maintenance, hospitality or an adventure team.  Please pray that the Lord provides the right people for these roles.\nOur campus will serve as the holiday grounds for nearly 1,000 Swedes during one of our biggest Scandinavian holidays  Midsomer.  Join us in praying for the logistics, which can be challenging, as well our opportunity to reach out to these listeners as many of them have no relationship with the Lord.\nFor us personally:\nWe have been blessed with our first child, Eleri.  Like all new parents, we need prayer for wisdom, patience and love for our little girl.</p>\n'),
